import React from 'react';
import './AboutUs.css';

const Team = () => {
  const teamMembers = [
    {
      id: 1,
      name: 'Imashi Thakshila',
      imgSrc: '',
      position: 'Software Engineer',
      bio: 'Bio for Imashi Thakshila',
    },
    {
      id: 2,
      name: 'Tharushi Dilisha',
      imgSrc: '',
      position: 'Software Engineer',
      bio: 'Bio for Tharushi Dilisha',
    },
    {
      id: 3,
      name: 'Akash Perera',
      imgSrc: '',
      position: 'Software Engineer',
      bio: 'Bio for Akash Perera',
    },
    {
      id: 4,
      name: 'Harini Tharupa',
      imgSrc: '',
      position: 'Software Engineer',
      bio: 'Bio for Harini Tharupa',
    },
    {
      id: 5,
      name: 'Nipuni Pathirana',
      imgSrc: '',
      position: 'Software Engineer',
      bio: 'Bio for Nipuni Pathirana',
    },
    // Add more team members here
  ];

  return (
    <div className="team">
      <h2>Meet Our Team</h2>
      <div className="team-members">
        {teamMembers.map((member) => (
          <div key={member.id} className="team-member">
            <img src={member.imgSrc} alt={member.name} />
            <h3>{member.name}</h3>
            <p>{member.position}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Team
